import React from 'react';
import Logo from '../images/logo.svg';

function Footer() {
    return (
        <footer>
            <img src={Logo} alt="logo"/>
            <div>
                <a href="#" target="_blank">About</a>
                <a href="#" target="_blank">Services</a>
                <a href="#" target="_blank">Projects</a>
            </div>
        </footer>
    )
}

export default Footer;
